import Heading from "./Heading";
import Para from "./Para";
import './styl.css';
<link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.2/dist/css/bootstrap.min.css" rel="stylesheet"></link>


function App()
{

    return( <>

<div className="note-card">
  <input type="text" placeholder="Title" />
  <textarea placeholder="Write a sss..." />
  <button className="btn btn-primary plus-btn">+</button>
</div>

<div className="note-card" style={{ alignSelf: "flex-start", marginLeft: "40px" }}>
  <input type="text" />
  <textarea />
  <button className="btn btn-primary plus-btn">-</button>
</div>

       
    </>
    ); 
}

export default App;
